data.description:
@Zensaties is een klein gezellig Zentrum voor zelfgenezing. Het is een plek voor mensen die op zoek zijn naar een moment van rust in zichzelf en in de stad. Het is een plek waar je wordt uitgenodigd om te ontspannen, te bewegen, te helen, te pauzeren en liefde en bewustzijn te cultiveren. De small group lessen vergroten kracht en balans, worden met persoonlijke aandacht gedacht in een vertrouwde omgeving. Doe mee met een van onze lessen voor je wekelijkse energieboost en stressvermindering.
Wees welkom in ons Zentrum om Reiki, yoga, meditaties, klankhealing en massages te ervaren
Just Zen It!
